import React from 'react';

import RowTable from './RowTable';
import ConsoleCountRow from './ConsoleCountRow';

function TableList (props){
    
    return(

          <div className={props.classname}>
                <table className={props.classname1}>
                    <thead className={props.classname1}>
                        <tr className={props.classname1}>
                        {
                            props.columnName.map((name, index) =>  <th key={index}> {name} </th>)
                        }
                        </tr>
                      </thead>

                      <tbody>
                        {
                                props.dataTable.map((data, index) =>
                                                    <RowTable
                                                        dataRow={data}
                                                        key={index}
                                                        onclick={props.onclick}
                                                    />)
                        }
                        </tbody>
                </table>
                <ConsoleCountRow
                />
        </div>

    )
}

export default TableList
